import "./App.css";

function parser({ table }) {
  return table.rows
    .map((row) => [
      ...table.cols.map((col, index) => ({ [col.label]: row.c[index].v })),
    ])
    .map((data) => data.reduce((acc, value) => ({ ...acc, ...value }), {}));
}

function App() {
  const getData = (url) => {
    const data = fetch(url)
      .then((res) => res.text())
      .then((text) => JSON.parse(text.substr(47).slice(0, -2)));

    return data.resolve();
  };

  const data = getData(
    "https://docs.google.com/spreadsheets/d/1CaEwqnqAHElnM_sOKOn9m92XWqnSCv_XnHQlncy5Vl4/gviz/tq?tqx=out:json"
  );

  console.log(data);

  console.log(parser(data));

  return <div className="App">{/* <RolezandoList list={data} /> */}</div>;
}

export default App;
